// klite-rpmod-stable-ui-embedded.js
// This file contains the Stable UI HTML embedded as a JavaScript constant
// See https://github.com/AUTOMATIC1111/stable-diffusion-webui for the project
// StableUI is used under AGPL in unedited form

const KLITE_STABLE_UI_BASE64 = "";

class KLITEEmbeddedStableUI {
    constructor() {
        this.modal = null;
        this.iframe = null;
    }
    
    open() {
        if (!this.modal) this.createModal();
        
        // Decode base64 to HTML
        const html = decodeURIComponent(escape(atob(KLITE_STABLE_UI_BASE64)));
        
        // Create blob URL
        const blob = new Blob([html], { type: 'text/html' });
        const blobUrl = URL.createObjectURL(blob);
        
        // Load in iframe
        this.iframe.src = blobUrl;
        this.modal.style.display = 'flex';
        
        // Clean up
        this.iframe.onload = () => URL.revokeObjectURL(blobUrl);
    }

    // Create the modal structure
    createModal() {
        // Create modal container
        this.modal = document.createElement('div');
        this.modal.className = 'klite-rpmod-modal klite-rpmod-fullscreen-modal';
        this.modal.style.display = 'none';
        this.modal.innerHTML = `
            <div class="klite-rpmod-modal-header">
                <h2>Image Generator (Embedded)</h2>
                <button class="klite-rpmod-modal-close">×</button>
            </div>
            <div class="klite-rpmod-modal-body" style="flex: 1; width: 100%; height: calc(100% - 60px); padding: 0;">
                <iframe style="width: 100%; height: 100%; border: none;"></iframe>
            </div>
        `;

        // Get references
        this.iframe = this.modal.querySelector('iframe');
        const closeBtn = this.modal.querySelector('.klite-rpmod-modal-close');

        // Close button handler
        closeBtn.addEventListener('click', () => this.close());

        // Add to document
        document.body.appendChild(this.modal);

        // Listen for messages from iframe
        window.addEventListener('message', (event) => {
            if (event.data.type === 'stableUIReady') {
                console.log('Stable UI embedded and ready');
            }
        });
    }

    // Send theme information to embedded UI
    sendThemeToIframe() {
        if (!this.iframe || !this.iframe.contentWindow) return;

        const theme = {
            '--bg-color': getComputedStyle(document.documentElement).getPropertyValue('--klite-rpmod-bg'),
            '--text-color': getComputedStyle(document.documentElement).getPropertyValue('--klite-rpmod-text'),
            '--accent-color': getComputedStyle(document.documentElement).getPropertyValue('--klite-rpmod-accent'),
            '--border-color': getComputedStyle(document.documentElement).getPropertyValue('--klite-rpmod-border'),
            '--button-bg': getComputedStyle(document.documentElement).getPropertyValue('--klite-rpmod-button-bg'),
            '--button-hover': getComputedStyle(document.documentElement).getPropertyValue('--klite-rpmod-button-hover')
        };

        this.iframe.contentWindow.postMessage({
            type: 'updateTheme',
            theme: theme
        }, '*');
    }

    // Close the modal
    close() {
        if (this.modal) {
            this.modal.style.display = 'none';
            this.iframe.src = ''; // Clear iframe
        }
    }

    // Clean up blob URL when done
    destroy() {
        if (this.blobUrl) {
            URL.revokeObjectURL(this.blobUrl);
            this.blobUrl = null;
        }
        if (this.modal) {
            this.modal.remove();
            this.modal = null;
        }
    }
};

// Make the class available globally
window.KLITEEmbeddedStableUI = KLITEEmbeddedStableUI;
